import React, { useState } from "react";
import Filter from "./Filter";
import Footer from "./Footer";
import JSonData from "../src/MOCK_DATA.json";

const SearchInput = () => {
    return(
        <input type="text" className=" pl-3 h-12 w-96 bg-gray-500 bg-opacity-100 border-gray-800 text-2xl rounded-md border-2 mt-5 text-black" placeholder="Search....." />
    );
}

const Search = () => {

    return(
        <div className=" justify-center items-center">
            <Filter value="Search Filter" />

            <div className="grid justify-center items-center">
                <SearchInput />
                {JSonData.map((val,key) => {
                    return(
                        <div className=" items-center justify-center gird">
                            {val.first_name}
                        </div>
                    );
                })}
            </div>
            
            <Footer value="Designed by OYEKUNLE DARE EMMANUEL" />
        </div>
    );
}

export default Search;
